import React from 'react';

function ExtraComponent() {
    return (
        <div className="mt-8 p-4 bg-white shadow-md rounded-lg">
        <h2 className="text-2xl font-semibold text-green-500">This is an Extra Component</h2>
        <p className="mt-2 text-gray-600">Tailwind styles should apply here as well.</p>
        <button className="mt-4 px-4 py-2 bg-green-500 text-white rounded hover:bg-green-600 transition duration-300">
                          Click Me
        </button>
        </div>
        );
}

export default ExtraComponent;
